namespace fs = std::filesystem;

std::vector<std::string> getGXLFiles(const std::string &folderPath) {
    std::vector<std::string> gxlFiles;
    for (const auto &entry: fs::directory_iterator(folderPath)) {
        if (entry.is_regular_file() && entry.path().extension() == ".gxl") {
            gxlFiles.push_back(entry.path().filename().string());
        }
    }
    return gxlFiles;
}

void writeCsv(const vector<tuple<string, string, string, string, double, double>> &branch, const vector<tuple<string, string, string, string, double, double>> &lb, const std::string &outputPath) {
    std::ofstream file(outputPath);
    if (!file.is_open()) {
        std::cerr << "Error while opening file" << std::endl;
        return;
    }
    file << std::fixed << std::setprecision(2);

    // Write data
    for (int i = 0; i < lb.size(); i++) {
        file << "lb," << get<1>(lb[i]) << "," << get<2>(lb[i]) << "," << get<3>(lb[i]) << "," << get<4>(lb[i]) << "," << get<5>(lb[i]) << std::endl;
    }


    for (int i = 0; i < branch.size(); i++) {
        if (get<0>(branch[i]) == "0") {
            file << "branch," << get<1>(branch[i]) << "," << get<2>(branch[i]) << "," << get<3>(branch[i]) << "," << get<4>(branch[i]) << "," << get<5>(branch[i]) << std::endl;
        } else {
            file << "uni," << get<1>(branch[i]) << "," << get<2>(branch[i]) << "," << get<3>(branch[i]) << "," << get<4>(branch[i]) << "," << get<5>(branch[i])  << std::endl;
        }
    }


    file.close();
    std::cout << "Data written to " + outputPath + "\n";
    return;
}

